import React from 'react';
import { BrowserRouter as Router, Route, Switch, Routes } from 'react-router-dom';
//import Header from './Header';
import LoginPage from './components/LoginPage';
import RegisterPage from './components/RegisterPage';
import AdminPanel from './components/AdminPanel';
import OpenComplaints from './components/OpenComplaints';
import SolvedComplaints from './components/SolvedComplaints';
import ComplaintDetail from './components/ComplaintDetail';
import CreateComplaint from './components/CreateComplaint';
import UserComplaints from './components/UserComplaints';

function App() {
  return (
    <Router>
      <div className="App">
       
        <Routes>
          <Route exact path="/" component={LoginPage} />
          <Route path="/register" component={RegisterPage} />
          <Route path="/admin" component={AdminPanel} />
          <Route path="/complaints/open" component={OpenComplaints} />
          <Route path="/complaints/solved" component={SolvedComplaints} />
          <Route path="/complaint/:id" component={ComplaintDetail} />
          <Route path="/complaint/create" component={CreateComplaint} />
          <Route path="/user/complaints" exact component={< UserComplaints/> } />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
